import {ITask} from "../../../shared/interfaces/ITask";
import React from 'react';
import './tasks.scss';

const Task: React.FunctionComponent<ITask> = (task: ITask) => {
    return (
        <div className="task-wrapper">
            <div className="task-wrapper_item">
                <span className="task-wrapper_item__name">
                    {task.title}
                </span>
            </div>
            <div className="task-wrapper_item">
                <span className="task-wrapper_item__name">
                    {task.scheduled}
                </span>
            </div>
            <div className="task-wrapper_item">
                <span className="task-wrapper_item__name">
                    {task.assignTo? task.assignTo : 'select driver'}
                </span>
            </div>
            <div className="task-wrapper_item">
                <span className="task-wrapper_item__name">
                    {task.address}
                </span>
            </div>
            <div className="task-wrapper_item">
                <span className="task-wrapper_item__name">
lat: 123, long: 123
                </span>
            </div>
        </div>
    )
};

export default Task;
